import React from "react";

import doc from "./../assets/images/icon-docs.svg";

interface IProps {
  url: string;
}

const FileMessage: React.FC<IProps> = ({ url }) => {
  const urlSplitted = url.split('/');
  const archiveName = urlSplitted[urlSplitted.length - 1];
  return <div className="ct-d-flex ct-flex-nowrap">
    <a href={url} download target="_blank" rel="noopener noreferrer">
      <img alt="Doc" src={doc} />
      <div style={{ fontWeight: "bold" }}>{archiveName}</div>
    </a>
  </div>
};

export default FileMessage;
